CREATE TRIGGER [dbo].[InsertUser] ON [dbo].[AspNetUsers] 
  AFTER INSERT
AS 
BEGIN

   IF exists (SELECT * FROM inserted) and not exists(SELECT * FROM deleted)
		BEGIN
			 --INSERT Activity
			 INSERT INTO [photoShare].[Users]
				SELECT [Id]
					  ,[FirstName]
					  ,[LastName]
					  ,[Email]
					  ,[UserName]
					  ,[PasswordHash]
					  ,GETDATE()
					  ,[DateOfBirth]
					  ,[Sex]
					  ,[PhoneNumber]
					  ,NULL
				FROM Inserted
		END
END
