CREATE PROCEDURE [photoShare].[GetPhotosByUserId] @UserId int as 
SELECT * FROM 
[photoShare].photoFiles files
INNER JOIN photoShare.Photos Photos
ON files.PhotoFileID = Photos.PhotoFileId
WHERE Photos.UploadedUserId = @UserId 



